import './App.css';
import { Headers } from './components'
import { Login, Register, MainPage } from './'
import Container from '@mui/material/Container'
import { Route } from 'react-router-dom';

function App() {
    return (
      <>
      <Headers />
            <Container maxWidth="lg">
                <Routes>
                    <Route path="/" element={ <MainPage />}/>
                      < MainPage />

                </Routes>
      </Container>
      </>
  );
}

export default App;
